  false,\n\t\"url\": null,\n\t\"notes\": \"NOAA's Medium Resolution Digital Vector
  Shoreline is a high-quality, Geographic Information System-ready, general-use digital
  vector data set created by the Strategic Environmental Assessments (SEA) Division
  of NOAA's Office of Ocean Resources Conservation and Assessment. The Medium Resolution
  Digital Vector Shoreline is now managed by the NOS Coastal Services Center (CSC).
  Compiled from hundreds of NOAA coast charts, this product comprises over 75,000
  nautical miles of coastline (nearly 2.5 million vectices), representing the entire
  coterminous United States of America. Alaska, the Hawaiian Islands, Puerto Rico,
  and all other interests and territories of the United States are not included in
  the collection.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
